import React from "react";
import { connect } from "react-redux";



function Home (props) {
    return (
        <div></div>
    );
  }
  

  
const mapDispatchToProps = dispatch => ({
    goToCreateUser: () => dispatch(push(routes.home)),
  });

  export default connect(null, mapDispatchToProps)(Home);
